import React from 'react'
import './PintrestStyle.css'
import { PinterestPinWidget } from 'react-pinterest';


const Pintrest = () => {
    return (
        <div className='pintrest-container'>
            <div className='pintrest-box'>
                <div className='pintrest-board'>
                    <PinterestPinWidget size="large" pin="530158187357124374" />


                </div>
            </div>
        </div>
    )
}

export default Pintrest
